"use strict";(self.webpackChunkarchipelago_documentation_docsaurus=self.webpackChunkarchipelago_documentation_docsaurus||[]).push([[6034],{8263:e=>{e.exports=JSON.parse('{"label":"Archipelago Multi Importer","permalink":"/archipelago-documentation-docusaurus/docs/tags/archipelago-multi-importer","allTagsPath":"/archipelago-documentation-docusaurus/docs/tags","count":5,"items":[{"id":"ami_index","title":"Archipelago Multi-Importer (AMI)","description":"Archipelago Multi-Importer (AMI) is a module for batch/bulk/mass ingests of Archipelago digital objects (ADOs) and collections. AMI also enables you to perform batch administrative actions, such as updating, patching/revising, or deleting digital objects and collections. AMI\'s Solr Importer plugin can be used to create AMI ingests and migrating content from existing Solr-sourcable digital repositories (such as Islandora 7).","permalink":"/archipelago-documentation-docusaurus/docs/ami_index"},{"id":"AMIviaSpreadsheets","title":"Ingesting New Digital Objects and Collections using Spreadsheets or Google Sheets","description":"Ingesting Only Digital Objects or Both Digital Objects and Collections uses similar processes, with a few key differences. Click here to jump to the Ingesting Both New Digital Objects and Collections section of this guide page.","permalink":"/archipelago-documentation-docusaurus/docs/AMIviaSpreadsheets"},{"id":"ami_spreadsheet_overview","title":"Spreadsheet Formatting Overview","description":"Spreadsheet Formatting Overview","permalink":"/archipelago-documentation-docusaurus/docs/ami_spreadsheet_overview"},{"id":"ami_lod_rec","title":"Using AMI\'s Linked Data Reconciliation","description":"Archipelago Multi Importer (AMI)\'s Linked Data Reconciliation tool can be used to enrich your metadata with Linked Data (LoD). Using this tool, you can map values from your topical/subject metadata elements to your preferred LoD vocabulary source. These mappings can then be transformed via a corresponding Metadata Display (Twig) template to process the values into JSON-formatted metadata for your specified AMI set.","permalink":"/archipelago-documentation-docusaurus/docs/ami_lod_rec"},{"id":"I7solrImporter","title":"Using the Islandora 7 Solr Importer","description":"From either the main Content page or the AMI Sets List page, select the \'Start an AMI set\' button to begin.","permalink":"/archipelago-documentation-docusaurus/docs/I7solrImporter"}]}')}}]);